import './App.css';

import Mensaje from './Mensaje.js';

function App() {
  return (
    <div className="App">
      <Mensaje message="Estamos trabajando"/>
      <Mensaje message="En un curso"/>
      <Mensaje message="De react"/>
    </div>
  );
}

export default App;
